            <img id="arrow-down" className="arrow_down" src="../images/arrow-down.png" alt="arrow-down" height="25px" />
          </div>
        </section>

        <section className="cards__catalog" id="cardsCatalog">
        </section>
      </main>
    </div>
  );
}

export default App;
